#include <stdlib.h>

int primeCount(int x) {
    int count = 0;
    for (int i = 2; i <= x; i++) {
        if (x % i == 0) {
            while (x % i == 0) x /= i;
            count++;
        }
    }
    return count;
}

int compare(const void* a, const void* b, void* nums) {
    int* arr = (int*)nums;
    int l = *(const int*)a;
    int r = *(const int*)b;
    int leftPrimeCount = primeCount(arr[l]);
    int rightPrimeCount = primeCount(arr[r]);
    if (leftPrimeCount == rightPrimeCount) return arr[r] - arr[l];
    return rightPrimeCount - leftPrimeCount;
}

int maximumScore(int* nums, int numsSize, int k) {
    long long score = 1;
    int mod = 1000000007;
    int* indices = (int*)malloc(sizeof(int) * numsSize);
    for (int i = 0; i < numsSize; i++) {
        indices[i] = i;
    }

    qsort_r(indices, numsSize, sizeof(int), compare, nums);

    for (int i = 0; i < k; i++) {
        score = (score * nums[indices[i]]) % mod;
    }

    free(indices);
    return (int)score;
}
